package com.vueblog.entity;import java.io.Serializable;/* * 版    权:  operate Copyright 2014-2016,All rights reserved * 文 件 名:  GoodsBean.java * 描       述:  唯一编号 * 作者:  xiangmiao * 时间:  2020-07-11 11:24:07 星期六 */public class GoodsBean implements Serializable{	private static final long serialVersionUID = -6015798038953366616L;	/**	 * 主键	 */	private Long id;	/**	 * 商品名称	 */	private String name;		/**	*商品库存数量	*/	private Long stockNum;	/**	*商品金额	*/	private Double money;	/**	*创建时间戳	*/	private Long createTime;	/**	*更新时间戳	*/	private Long updateTime;	/**	*删除标志 0：未删除；1：已删除	*/	private int isDeleted;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public Long getStockNum() {		return stockNum;	}	public void setStockNum(Long stockNum) {		this.stockNum = stockNum;	}	public Double getMoney() {		return money;	}	public void setMoney(Double money) {		this.money = money;	}	public Long getCreateTime() {		return createTime;	}	public void setCreateTime(Long createTime) {		this.createTime = createTime;	}	public Long getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Long updateTime) {		this.updateTime = updateTime;	}	public int getIsDeleted() {		return isDeleted;	}	public void setIsDeleted(int isDeleted) {		this.isDeleted = isDeleted;	}}